import './Country.css';

export function Country (c) {
    return (
        <div className='countryCard'>
            <img className='img' src= {c.flag} />
              <div className='list' >
              <h2>{c.name}</h2>
              </div>
              <div >
              <h3>{c.continent}</h3>
              </div>
        </div>

    )
};

export default Country;
